import Header from '../components/organism/Header'
import logo from '../assets/LogoLeafName-removebg.png'

function Error() {
    return (
        <div>
            <Header className="w-full"/>
            <img src={logo} alt="logo" className="h-96 w-96 mx-auto"/>
        </div>
    )
}

export default Error;
